import React from 'react'
import './UpperHeading.css'
import { Link } from 'react-router-dom'

const UpperHeading = () => {
  return (
    <div>
        <Link to="/"></Link>
      <h1 className='mt-3 upper-heading'>Welcome To Star Wars Universe</h1>
    </div>
  )
}

export default UpperHeading
